CREATE DATABASE IF NOT EXISTS `mydb`;

-- mydb.users definição

CREATE TABLE IF NOT EXISTS `users` (
  `id` binary(16) NOT NULL,
  `deleted` bit(1) DEFAULT NULL,
  `email` varchar(255) NOT NULL,
  `name` varchar(255) NOT NULL,
  `password` varchar(255) DEFAULT NULL,
  `phone` varchar(255) DEFAULT NULL,
  `url_image` varchar(255) DEFAULT NULL,
  `id","deleted","email","name","password","phone","url_image` varchar(128) DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `UK6dotkott2kjsp8vw4d0m25fb7` (`email`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;


-- mydb.teams definição

CREATE TABLE IF NOT EXISTS `teams` (
  `id` binary(16) NOT NULL,
  `deleted` bit(1) DEFAULT NULL,
  `name` varchar(255) NOT NULL,
  `url_image` varchar(500) DEFAULT NULL,
  `users_id` binary(16) DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `UKa510no6sjwqcx153yd5sm4jrr` (`name`),
  KEY `FKavydmycmchcsgmq5nje9rmyjr` (`users_id`),
  CONSTRAINT `FKavydmycmchcsgmq5nje9rmyjr` FOREIGN KEY (`users_id`) REFERENCES `users` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

-- mydb.players definição

CREATE TABLE IF NOT EXISTS `players` (
  `id` binary(16) NOT NULL,
  `name` varchar(255) NOT NULL,
  `number` int NOT NULL,
  `position` varchar(255) NOT NULL,
  `teams_id` binary(16) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `FK9hc9autuynaovo3rn3bth21xy` (`teams_id`),
  CONSTRAINT `FK9hc9autuynaovo3rn3bth21xy` FOREIGN KEY (`teams_id`) REFERENCES `teams` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;



-- mydb.championships definição

CREATE TABLE IF NOT EXISTS `championships` (
  `id` binary(16) NOT NULL,
  `award` float NOT NULL,
  `created_at` datetime(6) DEFAULT NULL,
  `description` varchar(255) DEFAULT NULL,
  `name` varchar(255) DEFAULT NULL,
  `qnt_teams` int DEFAULT NULL,
  `status` enum('FINISHED','IN_PROGRESS','SCHEDULED') DEFAULT NULL,
  `type` enum('CUP','LEAGUE') DEFAULT NULL,
  `users_id` binary(16) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `FKth5qewow8i6d5ttkb8mbmfp4m` (`users_id`),
  CONSTRAINT `FKth5qewow8i6d5ttkb8mbmfp4m` FOREIGN KEY (`users_id`) REFERENCES `users` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

-- mydb.championships_teams definição

CREATE TABLE IF NOT EXISTS `championships_teams` (
  `id` binary(16) NOT NULL,
  `championships_id` binary(16) NOT NULL,
  `team_id` binary(16) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `FKl1illnuva811bxsl7y1cht5ca` (`championships_id`),
  KEY `FKtr4v5k1vmto4y2bscy3b76lc` (`team_id`),
  CONSTRAINT `FKl1illnuva811bxsl7y1cht5ca` FOREIGN KEY (`championships_id`) REFERENCES `championships` (`id`),
  CONSTRAINT `FKtr4v5k1vmto4y2bscy3b76lc` FOREIGN KEY (`team_id`) REFERENCES `teams` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;


-- mydb.results definição

CREATE TABLE IF NOT EXISTS `results` (
  `id` binary(16) NOT NULL,
  `away_team_goals` int DEFAULT NULL,
  `home_team_goals` int DEFAULT NULL,
  `id_away_team` binary(16) DEFAULT NULL,
  `id_home_team` binary(16) DEFAULT NULL,
  `chamspionships_id` binary(16) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `FKhbo655eqvackh90dwn9tdahb3` (`chamspionships_id`),
  CONSTRAINT `FKhbo655eqvackh90dwn9tdahb3` FOREIGN KEY (`chamspionships_id`) REFERENCES `championships` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

-- mydb.statistics definição

