  `results_id` binary(16) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `FKwfdas61bx7evqqlx9vwv3a5b` (`chanspions_ships_has_teams_id`),
  KEY `FK1fgv4sdp051xbob4ncebsv1ce` (`players_id`),
  KEY `FKj3wm256bcu2dnohatygvr1sj1` (`results_id`),
  CONSTRAINT `FK1fgv4sdp051xbob4ncebsv1ce` FOREIGN KEY (`players_id`) REFERENCES `players` (`id`),
  CONSTRAINT `FKj3wm256bcu2dnohatygvr1sj1` FOREIGN KEY (`results_id`) REFERENCES `results` (`id`),
  CONSTRAINT `FKwfdas61bx7evqqlx9vwv3a5b` FOREIGN KEY (`chanspions_ships_has_teams_id`) REFERENCES `championships_teams` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;









